import { APIURL, APIPath } from "../../CommonMethods/Fetch";
import { postRecord, putRecord } from "../../CommonMethods/Save";
const APILogin = APIURL() + "agent-login";
const APIForgotPwd = APIURL() + "forgotpassword";
function Alert(props) {
    return <MuiAlert elevation={6} variant="filled" {...props} />;
}
const useStyles = makeStyles((theme) => ({
    backdrop: {
        zIndex: theme.zIndex.drawer + 9999,
        color: '#fff',
    },
    btn: {
        padding: "0 !important",
        color: "rgb(73, 80, 87) !important",
        float: "right",
        top: "-35px"
    }
}));
export default function AgentAdminLogin(props) {
    const AgentId = props.match.params.agentId;
    let history = useHistory();
    const { dispatch } = useContext(AuthContext);

    useEffect(() => {
        const LoginData = {
            "agentId": parseInt(AgentId),
            "role": "agent"
        }
        const new_data = {
            user: JSON.stringify(LoginData),
            token: JSON.stringify(LoginData)
        }
        dispatch({
            type: "LOGIN",
            payload: new_data
        });
        history.push(APIPath() + "agent-dashboard/admin");
    }, [AgentId]);



    return (
        <div>

        </div>
    );
};
